import Slider from "../../components/Carousel/carousel";
import Presta from "../Presta/presta.tsx";
import Aboutme from "../Aboutme/aboutme.tsx";
import Instacontact from "../Instacontact/instacontact.tsx";
import Footer from "../../components/Footer/footer.tsx";
import CookieConsent from "react-cookie-consent";

const Home = () => {
  return (
    <div>
      <CookieConsent
        message="Ce site utilise des cookies pour améliorer votre expérience. En continuant, vous acceptez notre politique de cookies."
        buttonText="Accepter"
        linkText="En savoir plus"
        allowAllCookies={true}
        enableDeclineButton
        onDecline={() => {
          alert("nay!");
        }}
      />
      <Slider />
      <Presta />
      <Aboutme />
      <Instacontact />

      <Footer />
    </div>
  );
};

export default Home;
